import React from 'react'
import Header from "../../component/Header";
import SubNavbar from "../../component/SubNavbar";
import Feature2 from '../../component/Feature2';

const Inbound = () => {
  const filters = [
    {
      label: "Filter by Ring Group",
      name: "filterByRingGroup",
      value: [
        "agents",
        "agents2",
        "agents3",
      ]
    }
  ]

  return (
    <div id="inbound">
      <Header />
      <div className='main-content'>
        <SubNavbar />
        <Feature2 />

        {filters.map((filter, index) => {
          return (
            <div className='filter'
            style={{ padding: "0 60px 40px 40px" }}
          >
            <label for={filter.name}>{filter.label}</label>
            <br></br>
            <select name={filter.name} id={filter.name}
              style={{ width: "240px", height: "30px", fontSize: "14px" }}
            >
              {filter.value.map((optionValue, optionIndex) => {
                return (
                  <option value={optionValue}>{optionValue}</option>
                )

              })}

            </select>
          </div>
          )

        })}



        {/* <label for="filterByRingGroup">Filter by Ring Group</label>
        <br></br>
        <select name="filterByRingGroup" id="filterByRingGroup"
          style={{ width: "240px", height: "30px", fontSize: "14px" }}
        >
          <option value="1">agents</option>
          <option value="2">agents2</option>
          <option value="3">agents3</option>
        </select> */}

      </div>
    </div>
  )
}

export default Inbound
